import React from "react";
import "./Style.css";
import constant from "./constants";

let colors = constant.colors;
const Number = props => (
  <button
    className="Number"
    style={
      ({ width: props.index === 16 ? "320px" : "60px" },
      { backgroundColor: colors[props.index] })
    }
  >
    {props.value}
  </button>
);

export default Number;
